import React, { createContext } from "react";
import all_knifes from '../Components/Assets/all_knifes'

export const KnifeContext = createContext(null);

const KnifeContextProvider = (props)=> {

    const contextValue = {all_knifes}

    return (
        <KnifeContext.Provider value={contextValue}>
            {props.children}
        </KnifeContext.Provider>
    )

}

export default KnifeContextProvider;
